import React from 'react'
import './Editprofile.css'

function Editprofile({ returntoprofile }) {

    document.getElementById("editpg").style.transform = "translateX(0%)";

    return (
        <div id="editpg" className='Editprofilepg'>
            <button className='returnbtn' onClick={returntoprofile}></button>
        </div>
    )
}

export default Editprofile
